import React from "react";
import Breweries from "../breweries/Breweries";
import Search from "../breweries/Search";
import Sidebar from "../layout/Sidebar";

const Home = props => {
  return (
    <div className="row">
      <div className="col-md-3">
        <Sidebar />
      </div>

      <main className="col-12 col-md-9 ml-sm-auto col-lg-10 px-4" role="main">
        <Search />
        <Breweries />
      </main>
    </div>
  );
};
// style={styles}
const styles = {
  backgroundColor: "rgba(255, 193, 7, 0.3)"
};

Home.propTypes = {};

export default Home;
